def subtypes_wine(directory: str) -> Dict:
    wine_types = wines['Type'].unique()
    wine_subtypes = {}

    for wine_type in wine_types:
        lower_type = wine_type.lower()
        wine_subtypes[lower_type] = wines[wines['Type'] == wine_type]

    return wine_subtypes
